import React from "react";

const Sidebar = () => {
  return (
    <div className="w-64 h-full bg-gray-200 p-5 border-r">
      <h3 className="text-lg font-semibold">Navigation</h3>
      <ul className="mt-4 space-y-3">
        <li>
          <a href="#" className="text-gray-700 hover:text-red-500">Upload & Process</a>
        </li>
        <li>
          <a href="#" className="text-gray-700 hover:text-red-500">View Results</a>
        </li>
        <li>
          <a href="#" className="text-gray-700 hover:text-red-500">About</a>
        </li>
      </ul>
    </div>
  );
};

export default Sidebar;
